import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

class Footer extends React.Component {


    render() {
        return (
            <div className="mt-3" style={{backgroundColor: "#F8F8F8", borderTop: "1px solid #CFCFCF"}}>
                <Container className="mt-3">
                    <Row>
                        <Col>
                            <h5>Contact Us</h5>
                        </Col>
                        <Col>
                            <h5>Help</h5>
                        </Col>
                        <Col>
                            <h5>Community</h5>
                        </Col>
                        <Col>
                            <h5>Follow Us</h5>
                        </Col>
                        <Col>
                            <h5>Reviews</h5>
                        </Col>
                    </Row>
                </Container>
            </div>
        )
    }
}
export default Footer;
